    {
        books {
            name 
            id
        }
    }
`

function BookList() {
    const data = useQuery(getBooksQuery)
    console.log(data);
    return (
          <div>
          <ul id="book-list">
            <li>Book name</li>
          </ul>
      </div>
    );
  }
  
export default BookList;
